import logo from "./logo.svg";
import "./App.css";
import React from "react";

class App extends React.Component {
  state = {
    isLogin: false,
  };
  loginWithKakao = () => {
    try {
      return new Promise((resolve, reject) => {
        if (!Kakao) {
          reject("Kakao 인스턴스가 존재하지 않습니다.");
        }
        Kakao.Auth.login({
          success: (auth) => {
            console.log("정상적으로 로그인 되었습니다.", auth);
            this.setState({
              isLogin: true,
            });
          },
          fail: (err) => {
            console.error(err);
          },
        });
      });
    } catch (err) {
      console.error(err);
    }
  };

  logoutWithKakao = () => {
    if (Kakao.Auth.getAccessToken()) {
      console.log(
        "카카오 인증 액세스 토큰이 존재합니다.",
        Kakao.Auth.getAccessToken()
      );
      Kakao.Auth.logout(() => {
        console.log("로그아웃 되었습니다.", Kakao.Auth.getAccessToken());
        this.setState({
          isLogin: false,
        });
      });
    }
  };
  componentDidMount() {
    Kakao.init("b7c5cb9042af5754b5af32fa54b1a96e");
    if (Kakao.Auth.getAccessToken()) {
      console.log("랙세스 토큰이 존재합니다. 세션을 유지합니다.");
      this.setState({
        isLogin: true,
      });
    }
  }

  render() {
    return (
      <header>
        <nav>
          <a class="header_nav_home" href="#">
            SSAFY 스터디 그룹 매칭 서비스
          </a>
          <a class="" href="#">
            공지사항
          </a>

          <div class="header_nav_search"></div>

          <div class="header_nav_menu">
            <div id="header_nav_confirm_off">
              <div class="header_nav_menuitem">
                <a class="nav_link" href="#">
                  로그인(카카로 연결)
                </a>
              </div>
              <div class="header_nav_menuitem">
                <a class="nav_link" href="#">
                  회원가입(카카오 연결)
                </a>
              </div>
            </div>
            <div id="header_nav_confirm_on">
              <div class="header_nav_menuitem">
                <a class="nav_link" href="#" style={{ display: "none" }}>
                  로그아웃
                </a>
              </div>
              <div class="header_nav_menuitem">
                <a class="nav_link" href="#" style={{ display: "none" }}>
                  마이페이지
                </a>
              </div>
              <div class="header_nav_menuitem">
                <a class="nav_link" href="#" style={{ display: "none" }}>
                  관리자
                </a>
              </div>
            </div>
          </div>
        </nav>
      </header>
    );
  }
}

export default App;
